# Binary Serach Algorithm

def binary_search(list,target):
  """
  Returns the index position of the target if found, else returns None
  TAKE INTO CONSIDERATION THAT THE LIST SHOULD BE SORTED FOR BINARY_SEARCH TO WORK
  It uses what is called iterative solution, which applies modifications to the variables
  which is not a proper way to solve the problem.
  """
  first_point = 0  #constant run time
  last_point = len(list)-1 #contant run time

  while last_point >= first_point:   #logarithmic run time
    try:
      mid_point = (first_point + last_point) // 2   #constant run time
      if list[mid_point] == target:  #constant run time
        return mid_point
      elif list[mid_point] < target: # constant run time
        first_point = mid_point + 1
      else:
        last_point = mid_point - 1
    except:
      return None

