import sys

def load_names(filename):
    names = []
    with open(filename, 'r') as file:
        for line in file:
            names.append(int(line.strip()))  # Assuming each number is on a new line
    return names

# Assuming sys.argv[1] is replaced with the actual filename for simplicity in explanation
filename = "names.txt"  # Example filename, replace with the actual file path
names = load_names(filename)

def binary_search(collection, target):
  first = 0
  last = len(collection) - 1
  while first <= last:
    midpoint = (first + last) // 2
    if collection[midpoint] == target:
      return midpoint
    elif collection[midpoint] < target:
      first = midpoint + 1
    else:
      last = midpoint - 1
  return None

for n in search_names:
  index = binary_search(names,n)
